// import dependencies

// import components
// utils
import { Button1 } from "../../utils/buttons";
import { Input1, Input2 } from "../../utils/inputs";
import { Navlink2 } from "../../utils/links";
import PrivateRoute from "../../utils/PrivateRoute";

const CreateBlog = () => {
  const handleSubmit = (e) => {
    e.preventDefault();
  };

  const content = (
    <>
      <form className="form" onSubmit={handleSubmit}>
        <Input1 label="title" />
        <Input1 label="subtitle" />
        <Input2 label="body" />
        <Input1 label="tags" />
        <Button1 text="SUBMIT" />
      </form>
      <Navlink2 text="return to dashboard" />
    </>
  );

  return <PrivateRoute content={content} title="New Blog" />;
};

export default CreateBlog;
